<template>
  <div class="container">
      <div class="header">
          <h1>Know our vision</h1>
      </div>
      <div class="section">
          <div class="showcase">
              <div class="hero-showcase">
                  <i class="fa-solid fa-star-shooting"></i>
              </div>
              <div class="hero-text">
                  <h1>Not just a simple website!</h1>
                  <h2>Netox create innovative web-applications and UI/UX designs at an affordable price. <br /><br /> Our code, primarily based on Vue.js/JavaScript, is highly professional and uses the best solutions to create a masterpiece for our clients. <br /><br /> We also use Font-Awesome, a top-notch SVG icon library, to enhance the overall look and feel of our designs.</h2>
              </div>
          </div>
          <div class="showcase">
              <div class="carousel">
                  <div class="steps">
                      <div class="percentage" :style="{ width: (100 * (sliderCount + 1) / slider.length) + '%' }"></div>
                  </div>
                  <button id="prev-btn" @click="sliderBtn">
                      <i class="fa-solid fa-left"></i>
                  </button>
                  <div class="content" v-show="sliderCount === index" v-for="(img, index) in slider" :key="index">
                      <img :src="img.path">
                      <div class="text-wrapper">
                          <h2>{{ img.name }}</h2>
                      </div>
                  </div>
                  <button id="next-btn" @click="sliderBtn">
                      <i class="fa-solid fa-right"></i>
                  </button>
              </div>
          </div>
      </div>
  </div>
</template>

<script>
import anime from "animejs";

export default {
    data() {
        return {
            sliderCount: 0,
            slider: [
                {
                    path: "data:image/png;base64,",
                    name: "ONE"
                },
                {
                    path: "data:image/png;base64,",
                    name: "TWO"
                },
                {
                    path: "data:image/png;base64,",
                    name: "THREE"
                },
                {
                    path: "data:image/png;base64,",
                    name: "FOUR"
                },
            ]
        }
    },
    methods: {
        sliderBtn(event) {
            anime({
                targets: '.content > *',
                easing: 'linear',
                opacity: [1, 0],
                translateY: [0, 50],
                duration: 250,
                delay: anime.stagger(100),
                complete: () => {
                    if (event.target.id === "next-btn") {
                        this.sliderCount = (this.sliderCount + 1) % this.slider.length
                    } else if (event.target.id === "prev-btn") {
                        this.sliderCount = (this.sliderCount + this.slider.length - 1) % this.slider.length
                    }
                    anime({
                        targets: '.content > *',
                        easing: 'linear',
                        opacity: [0, 1],
                        translateY: [50, 0],
                        duration: 250,
                        delay: anime.stagger(100),
                    })
                }
            })
        }
    },
    mounted() {

    }
}
</script>

